import axios from 'axios';
import React, { useEffect, useState } from 'react';
import Cards from './Cards';







function Search() {
  const [breed, setBreed] = useState('');
  const [dogs, setDogs] = useState([]);

  const handleBreedChange = (event) => {
    setBreed(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    axios
      .get(`https://frontend-take-home-service.fetch.com/dogs/search?breed=${breed}`, {
        withCredentials:true,
        headers: {
          'fetch-api-key': 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpYXQiOjE2NzgzMDU2MTF9.Ky49nXH6qgHJQ0CBsZGYsP7_Is2am3u5j3RAdEl457s' // replace with your actual API key
        }
      })
      .then(response => {
        setDogs(response.data.resultIds);
      })
      .catch(error => {
        console.log(error);
      });
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <label>
          Breed:
          <input type="text" value={breed} onChange={handleBreedChange} />
        </label>
        <button type="submit">Search</button>
      </form>
      <Cards dogs={dogs} />
    </div>
  );
}

export default Search;


